INSERT INTO `wp_posts` VALUES (25,1,'2021-05-18 13:17:51','2021-05-18 03:17:51','<!-- wp:group {\"className\":\"home-hero-container\"} -->\n<div class=\"wp-block-group home-hero-container\"><div class=\"wp-block-group__inner-container\"><!-- wp:media-text {\"mediaId\":15,\"mediaLink\":\"https://hannahgrace.local/face/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/face-1024x1024.jpg\" alt=\"\" class=\"wp-image-15 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading -->\n<h2>Facials</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Chicken brisket kielbasa strip steak, pancetta ground round pig biltong corned beef pork chop capicola meatloaf. Biltong swine prosciutto, hamburger pastrami sirloin pork loin frankfurter flank brisket fatback. Jerky flank bacon ham shankle biltong tail. Pork beef pancetta brisket kielbasa doner strip steak ham. Filet mignon shankle pastrami, tenderloin ribeye fatback doner salami brisket ball tip.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"right\",\"className\":\"md-btn\"} -->\n<p class=\"has-text-align-right md-btn\"><a href=\"https://hannahgrace.local/shop/\">Book Now</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:media-text --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"className\":\"home-hero-container\"} -->\n<div class=\"wp-block-group home-hero-container\"><div class=\"wp-block-group__inner-container\"><!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":17,\"mediaLink\":\"https://hannahgrace.local/legs/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img s